import React from 'react';


const SkillColumn = (props) => {

    return(
        <React.Fragment>
            <div className="col-lg-2 col-md-4 col-sm-6">
                <div className="skill-column" >
                    <div>
                        {props.pct}
                    </div>
                    <h4>{props.title}</h4>
                    <p>{props.description}</p>
                    <div>{props.icon}</div>
                </div>
            </div>

        </React.Fragment>

    );
}

export default SkillColumn;
